import React from "react";
import Navbar from "../components/Navbar";

function Cart() {
    return (
        <div>
            <Navbar />
            <h2
                style={{
                    backgroundColor: "#d3d3d3",
                    width: "100%",
                    height: "70px",
                    padding: "11px",
                    textAlign: "center",
                }}
            >
                Giỏ hàng của bạn
            </h2>
            <div>
                <table>
                    <tr>
                        <th>Tên sản phẩm</th>
                        <th>Giá</th>
                        <th>Số lượng</th>
                        <th>Thành tiền</th>
                    </tr>
                </table>
            </div>
        </div>
    );
}

export default Cart;
